UE provides a few options when referencing UObject instances: Type Example Direct object reference UObject*, AActor* Soft object reference TSoftObjectPtr<UObject>, TSoftClassPtr<UClass> Lazy object reference TLazyObjectPtr<UObject> Weak Object Reference TWeakObjectPtr<UObject> All of these are supported for completeness sake. The recommendation is: Use direct or soft object reference for common object references. It's the usual way to referencing objects. Use soft object reference when pointing to UDcImportedDataAsset/UDcPrimaryImportedDataAsset derived classes. It's specially handled that it won't load the object to deserialize. This means we can batch import a set of JSON assets that references each other, without the need to resolve the mutual dependencies among them. The downside is that we don't check that the object actually exist at import time. We allow a few options when referencing an object. Below is a example of object references: // DcJsonAssetTests/Private/DcTestImports2.h
UCLASS()
class UDcJsonAssetTestDataAsset3_References : public UDcImportedDataAsset { // ... UPROPERTY(EditAnywhere) UObject* DirectRef1; UPROPERTY(EditAnywhere) UObject* DirectRef2; UPROPERTY(EditAnywhere) UObject* DirectRef3; UPROPERTY(EditAnywhere) TSoftObjectPtr<UDcPrimaryImportedDataAsset> DcSoftImported1; UPROPERTY(EditAnywhere) TSoftObjectPtr<UDcPrimaryImportedDataAsset> DcSoftImported2;
}; // DcJsonAsset/Tests/DcJsonFixture_Refs.json
{ "$type" : "DcJsonAssetTestDataAsset3_References", "DirectRef1" : "Blueprint'/DcJsonAsset/DcFixture/DcTestBPDataAsset.DcTestBPDataAsset'", "DirectRef2" : "/DcJsonAsset/DcFixture/DcTestBPDataAsset", "DirectRef3" : { "$type" : "Blueprint", "$path" : "/DcJsonAsset/DcFixture/DcTestBPDataAsset" }, "DcSoftImported1" : "/DcJsonAsset/DcFixture/DcTestBPDataAssetInstance", "DcSoftImported2" : null
} Note that: DirectRef1/2/3 are deserialized into identical references to the same object. DcSoftImported1/2 are specially handled and /Path/To/Content are the only format that's supported. Blueprint classes can use FSoftObjectPath/FSoftClassPath to replace the templated C++ equivelent. It looks like this in the Blueprint editor: Schema-SoftObjectClassPath

