By default imported UDcImportedDataAsset object is destroyed and recreated on every import. Now $reimport-keep-instance changes the behavior and it would reuse the existing object. This is mostly for more advanced setups. The main reason we create a new object on every import is that one can hardly reset the values of the dirty object. Consider the example below: // DcJsonAsset/Tests/DcJsonFixture_Simple.json
{ "$type" : "DcJsonAssetTestPrimaryDataAsset1", "AlphaName" : "Foo", "AlphaBool" : true, "AlphaStr" : "Bar"
} // reimport with the new content below
// DcJsonAsset/Tests/DcJsonFixture_Simple_ReimportKeepInstance.json
{ "$type" : "DcJsonAssetTestPrimaryDataAsset1", "$reimport-keep-instance" : true, "AlphaStr" : "Changed"
} After reimport the resulting object would be like this: { "AlphaName" : "Foo", // dirty value from last time "AlphaBool" : true, // dirty value from last time "AlphaStr" : "Changed" // new value in reimport
}

