The first thing when importing a JSON asset is to determine which class to deserialize into. It's specified by the $type field in the JSON source: // DcJsonAsset/Tests/DcJsonFixture_Simple.json
{ "$type" : "DcJsonAssetTestPrimaryDataAsset1", "AlphaName" : "Foo", "AlphaBool" : true, "AlphaStr" : "Bar"
} We call all object keys with $ prefix meta fields . $type is one that's used a lot. Under the hood this $type field is handled separately from other fields: $type must be the first field in the object. In fact all meta fields are order significant and needs to start as the beginning keys of a object. $type values must refers to a UDcImportedDataAsset or UDcPrimaryImportedDataAsset children: If it's a native C++ class, refer to it by the class name without the U prefix. For example: DcJsonAssetTestPrimaryDataAsset1 If it's a Blueprint Class, refer to it by the Blueprint asset path. For example: /DcJsonAsset/DcFixture/DcTestBPDataAsset

